import React from "react";
import Check from "./Check";

const TodoItem = ({todo, changeTodo}) => {
    return (
        <button className='flex items-center mb-5 rounded-xl bg-gray-700 p-5 w-full' onClick={changeTodo}>
            <Check/>
            {todo.title}
        </button>
    )
}

export default TodoItem
